titleDescription:
Responsible for providing guidance to all team members, in addition to encouraging the success of accounts' retention, adoption and growth using FareHarbor. As Team Lead I have in-depth knowledge of existing tools and processes used by the Account Management Team, as well as a comprehensive  understanding of the team's responsibilities, operations and metrics of success. With this knowledge and expertise, I help to finetune the success of the department, flag issues and potential threats, identify opportunities for improvement and propose initiatives that benefit the team and beyond.   

Tasks and responsibilities include:

✔ Managing a reduced portfolio of mid-market and key accounts;
✔ Supporting Account Managers by active involvement in client escalations, cross-functional CX projects, growth strategies, and process related questions;
✔ Coordinating seasonal/recurring initiatives and projects with a focus on retention, adoption and growth; 
✔ Engaging in training, mentoring and development of AMs, leading workshops; 
✔ Providing continuous evaluation of processes, procedures and information flows; 
✔ Vetting new process updates and opportunities; 
✔ Suggesting methods to improve operations and efficiency;
✔ Involvement in client communication and problem solving for accounts at risk of churn due to escalation, functionality, or client service issues; 
✔ Create and maintain a high-quality work environment so team members are constantly motivated; 
✔ Serve as backup escalation point for the AM Manager.

Specific topics of interest and projects I worked on: 

✔ Google Analytics (key user), helping out global AMs and the product team with GA related questions and troubleshooting; 
✔ Roll-out and adoption of Google Analytics 4 in Europe; 
✔ Roll-out of FareHarbor - cookie consent solutions integration in Europe.

FareHarbor is all-in-one booking solution and business management platform that makes it easy to operate your tours, activities, rentals and attractions.

Responsibilities:
- Planning/Development/Maintenance of the project functionality;
- Communication with a team, investigations & preparing documentation;
- Resolving integration problems with 3rd party services;
